import React from 'react';
import Todoelement from './todoelement'
import { Context } from '../App2';


export default () => {
    return (
        <Context.Consumer>
            {
                (obj) => {
                    return (<ul className='list'>
                        {
                            obj.arr.map((t, i) => <li key={i} className='element'>
                                <Todoelement
                                    id={t.id}
                                    text={t.text}
                                    done={t.done}
                                />
                            </li>
                            )
                        }
                    </ul>);
                }
            }
        </Context.Consumer>
    );
}
